import React from 'react'
import {Button, Container} from 'react-bootstrap'
import { useDispatch, useSelector } from 'react-redux'
import { winAction } from '../actions/playerActions'
import { ADD_WIN, SUB_WIN } from '../constants/playerConstants'

function PlayerButton() {
    const dispatch = useDispatch()


    const winReducer = useSelector(state => state.winReducer)
    const {wins} = winReducer
  return (
    <Container>
        <Button variant="primary" onClick={dispatch({type: ADD_WIN})}>Primary</Button>
        <Button variant="danger" onClick={dispatch({type:SUB_WIN})}>Secondary</Button>
    </Container>
  )
}

export default PlayerButton
